Here’s a drop-in React component you can use in place of the placeholder `<CountdownTimer…/>`. It reads your start/end ISO timestamps, displays days/hours/minutes/seconds remaining, and fires an onComplete callback when time’s up.

```jsx
// VocabTimer.js

import React, { useState, useEffect } from 'react';

export default function CountdownTimer({ Ele, StartDate, EndDate, onComplete }) {
  const parseISO = s => new Date(s).getTime();
  const endTime = parseISO(EndDate);
  const startTime = parseISO(StartDate);

  // Only start ticking once startTime is reached
  const now = Date.now();
  const initialRemaining = Math.max(0, endTime - Math.max(now, startTime));
  const [remaining, setRemaining] = useState(initialRemaining);

  useEffect(() => {
    if (now < startTime) {
      // wait until startTime
      const timeout = setTimeout(() => setRemaining(endTime - startTime), startTime - now);
      return () => clearTimeout(timeout);
    }
    if (remaining <= 0) {
      onComplete && onComplete();
      return;
    }
    const interval = setInterval(() => {
      setRemaining(r => {
        const next = r - 1000;
        if (next <= 0) {
          clearInterval(interval);
          onComplete && onComplete();
          return 0;
        }
        return next;
      });
    }, 1000);
    return () => clearInterval(interval);
  }, [remaining, startTime, endTime, onComplete, now]);

  const fmt = ms => {
    const totalSec = Math.floor(ms / 1000);
    const days = Math.floor(totalSec / 86400);
    const hrs = Math.floor((totalSec % 86400) / 3600);
    const mins = Math.floor((totalSec % 3600) / 60);
    const secs = totalSec % 60;
    return `${days}d ${hrs}h ${mins}m ${secs}s`;
  };

  return (
    <div id={Ele} className="vocab-countdown">
      {remaining > 0 ? fmt(remaining) : "Time's up!"}
    </div>
  );
}
```

Usage in your app (e.g. in `App.js` or wherever NODE_TIMER is instantiated):

```jsx
import CountdownTimer from './VocabTimer';

function App() {
  return (
    <div>
      {/* ... other UI nodes ... */}
      <CountdownTimer
        Ele="vocab_timer_user001"
        StartDate="2025-07-15T09:00:00"
        EndDate="2025-08-15T09:30:00"
        onComplete={() => alert('Time up!')}
      />
      {/* ... */}
    </div>
  );
}
```

Just drop in these two files and you’ll have a live countdown matching your design parameters.

